import { BrowserRouter as Router, Route, IndexRoute } from "react-router-dom"

import ConnectBtn from "./components/ConnectBtn";
import PopUpForm from "./components/PopUpForm";
import WifiLoader from "./components/WifiLoader";
import ConnectedWindow from "./components/ConnectedWindow";

function App() {
  return (
    <div className="App">
      <Router >
        <Route path={"/"} component={ConnectBtn}>
           <IndexRoute/>
          <Route path={"ipform"} component={PopUpForm}></Route>
        </Route>
      </Router>
      {/* <ConnectBtn></ConnectBtn> */}
      {/* <PopUpForm></PopUpForm> */}
      {/* <WifiLoader></WifiLoader> */}
      {/* <ConnectedWindow></ConnectedWindow> */}
    </div>
  );
}

export default App;
